import Header from "./Header";
import Footer from "./Footer";
const Layout = props => {
  return (
    <div className="layout">
      <Header />
      {props.children}
      <Footer />

      <style jsx>{`
        *{
            margin:0;
            padding:0;
            box-sizing: border
        }
        .layout{
            width:100%;
            height:100vh;
            background: pink
        }
      `}</style>
    </div>
  );
};
export default Layout;
